import React from "react";

const AadharCardDisplay = ({ userDetails, uid }) => {
  return (
    <div className="aadhar-card">
      <h2>Aadhar Card</h2>
      <div className="user-details">
        <p>
          <strong>Name:</strong> {userDetails.fullName}
        </p>
        <p>
          <strong>Date of Birth:</strong> {userDetails.dob}
        </p>
        <p>
          <strong>Address:</strong> {userDetails.address}
        </p>
        <p>
          <strong>Contact Information:</strong> {userDetails.contact}
        </p>
      </div>
      <div className="uid">
        <p>
          <strong>UID:</strong> {uid}
        </p>
      </div>
    </div>
  );
};

export default AadharCardDisplay;
